import Wrapper from './components/Wrapper.js'
import Note from './components/Note.js'

function App() {
  const submitHandler = (e) => {
    const todoText = e.target.innerHTML;
    console.log(todoText);
  }
  return (
    <div className="App">
      <Wrapper>
        <Note classname = 'text-box' onclick = {submitHandler}>
        </Note>
      </Wrapper>
    </div>
  );
}

export default App;
